import "./App.css";
import Search from "./components/Search";
import Weather from "./components/Weather";

function App() {
  const handleOnSearchChange = (searchData) => {
    searchData;
  };

  return (
    <div className="container">
      <Search OnSearchChange={handleOnSearchChange} />
      <Weather />
    </div>
  );
}

export default App;
